window.addEventListener("load", (function() {
    $.getScript("https://webwork.pcc.edu/webwork2_files/node_modules/iframe-resizer/js/iframeResizer.min.js").done((function(e, t) {
        iFrameResize({
            log: !1,
            inPageLinks: !0,
            resizeFrom: "child",
            checkOrigin: ["https://webwork.pcc.edu"]
        })
    }
    ));
    let e = document.getElementsByTagName("iframe");
    for (let t = 0; t < e.length; t++) {
        let n, a = e[t];
        if (n = a.hasAttribute("tag") ? a.getAttribute("tag") : a.src,
        null != n && n.toLowerCase().includes("webwork")) {
            let e = /problemSeed=\d*&/;
            n = n.replace(e, "problemSeed=" + Math.floor(9999 * Math.random()) + "&"),
            a.src = n
        }
    }
}
)),
$.each($(".component-sample"), (function() {
    var e = $(this).html()
      , t = {
        "<": "&lt;",
        ">": "&gt;",
        "  ": ""
    };
    e = e.replace(/<|>|  /gi, (function(e) {
        return t[e]
    }
    )),
    $(this).append('<pre class="code-sample copy-this card bg-light"><code>' + e + '</code></pre><p><button class="btn copy-btn" data-toggle="tooltip" data-placement="top" title="Copy Code To Clipboard">Copy Code</button></p>')
}
)),
$(".copy-btn").on("click", (function() {
    var e = $(this).parent().prev(".copy-this")
      , t = String(e[0].textContent)
      , n = document.createElement("textarea");
    n.value = t,
    document.body.appendChild(n),
    n.select(),
    document.execCommand("copy"),
    document.body.removeChild(n),
    $(this).html("Code Copied")
}
)),
$.each($(".accordion"), (function(e) {
    $(this).attr("id", "accordion_" + parseInt(e + 1))
}
)),
$.each($(".accordion > .card"), (function(e, t) {
    var n = e + 1;
    $(t).children(".card-header").attr("id", "heading_acc_" + n),
    $(t).find(".card-header > .card-title").wrapInner('<button  class="btn btn-link" type="button" data-toggle="collapse" aria-expanded="false"></button>'),
    $(t).find(".card-header > .card-title > button").attr({
        "data-target": "#collapse_acc_" + n,
        "aria-controls": "collapse_acc_" + n
    }),
    $(t).children(".collapse").attr({
        id: "collapse_acc_" + n,
        "aria-labelledby": "heading_acc_" + n
    })
}
));
for (var bgImgWrapper = document.getElementsByClassName("bg-img-wrapper"), bgImgIndex = 0; bgImgIndex < bgImgWrapper.length; bgImgIndex++) {
    var bgImgWrapperId = "bg-img-wrapper-" + parseInt(bgImgIndex);
    document.querySelectorAll(".bg-img-wrapper")[bgImgIndex].setAttribute("id", bgImgWrapperId);
    var bgImg = document.getElementById(bgImgWrapperId).getElementsByTagName("img")[0].src;
    document.querySelectorAll(".bg-img-wrapper")[bgImgIndex].setAttribute("style", "background-image: url(" + bgImg + ");")
}
for (var links = document.querySelectorAll("a"), downloadIndex = 0, newWindowIndex = 0, linkIndex = 0; linkIndex < links.length; linkIndex++) {
    var srTxtWrapper = document.createElement("span");
    if (srTxtWrapper.classList.add("sr-only"),
    links[linkIndex].classList.contains("download")) {
        links[linkIndex].setAttribute("download", ""),
        links[linkIndex].setAttribute("id", "download-file-" + downloadIndex),
        links[linkIndex].setAttribute("title", "download file"),
        links[linkIndex].setAttribute("data-toggle", "tooltip");
        var srTxt = document.createTextNode("(this link downloads a file)");
        srTxtWrapper.appendChild(srTxt),
        links[linkIndex].appendChild(srTxtWrapper),
        downloadIndex++
    } else if (links[linkIndex].classList.contains("new-window")) {
        links[linkIndex].setAttribute("target", "_blank"),
        links[linkIndex].setAttribute("id", "new-window" + newWindowIndex),
        links[linkIndex].setAttribute("data-original-title", "opens in new window/tab"),
        links[linkIndex].setAttribute("data-toggle", "tooltip");
        srTxt = document.createTextNode("(this link opens in a new window/tab)");
        srTxtWrapper.appendChild(srTxt),
        links[linkIndex].appendChild(srTxtWrapper)
    }
}
$.each($(".list-group"), (function(e) {
    $(this).attr("id", "list-tab_" + parseInt(e + 1))
}
)),
$.each($(".list-group > .list-group-item"), (function(e, t) {
    var n = e + 1;
    $(t).attr({
        id: "list-" + n + "-list",
        href: "#list-" + n,
        "aria-controls": "list-" + n
    })
}
)),
$.each($(".tab-content"), (function(e) {
    $(this).attr("id", "nav-tabContent_" + parseInt(e + 1))
}
)),
$.each($(".tab-content > .tab-pane"), (function(e, t) {
    var n = e + 1;
    $(t).attr({
        id: "list-" + n,
        "aria-labelledby": "list-" + n + "-list"
    })
}
));
